import axios from 'axios';


export default class Devis extends Component {
    constructor(props) {
        super(props);
        this.state = {
            client: [],
        }
    }

    componentDidMount() {

        axios.get(`https://sayse.pipedrive.com/v1/deals?api_token=d168467b213a71acdc4ba5cb5b2cfe96529ac061`)
        .then(res => {
                res.data.data.forEach(element => {
                    this.setState({client: element.person_id.name})
                });
            });
    }

    render() {
